pragma solidity ^0.4.24;

contract TestTime {

    mapping(address => uint) public nextCardsPull; //address to timestamp
    mapping(address => uint) public ownerBoosters; //total Boosters owned


    constructor() public {
        nextCardsPull[msg.sender] = now + 1 minutes;
    }

    function getTimeStamp() public view returns (uint){
       return block.timestamp;
    }

    function getNow() public view returns (uint){
        return now;
    }

    //every minute the address can pull
    function getMinuteBooster() public returns (bool){
        if(now >= nextCardsPull[msg.sender]){
            //update the lastpull value
            nextCardsPull[msg.sender] = now + 1 minutes;
            ownerBoosters[msg.sender] += 3;
            return true;
        }
        return false;
    }

}
